import banner from "./images/blue-door.jpg";
impo
// import Navbar from '../Navbar/Navbar';
const Home = () => {
  return (
    <>
      {/* <Navbar/> */}

      <div className="mt-20 bg-slate-200	w-full h-lvh top-0 left-0">
        <div className="flex justify-evenly	items-center	">
          <div>
            <p className="text-6xl font-serif leading-tight	 text-black tracking-wider">
              The Perfect Door
              <br /> For every <br />
              Occasion
            </p>
          </div>
          <div>
            <div
              // style={{
              //   background: "#F8F8F8",
              //   height: "550px",
              //   width: "350px",
              //   borderTopLeftRadius: "50%",
              //   borderTopRightRadius: "50%",
              // }}
            >
              <div
                style={{
                  border: "1px solid gray",
                  background: "#F8F8F8",
                   height: "630px",
                   width: "480px",
                  borderTopLeftRadius: "50%",
                  borderTopRightRadius: "50%",
                  marginTop:"18%"
                }}
              >
                <img src={banner} height="400px" width="200px" style={{marginTop:"22%",marginLeft:"28%"}}/>
              </div>

              <div>
                <img src={high} alt="" />
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Home;
